import "./App.css";
import React, { useState } from "react";

function App() {
  const [item, setItemList] = useState([]);

  const inputItem = (e) => {
    setItemList(e.target.value);
  };

  const addItem = () => {};

  return (
    <div className="App">
      <h1> ToDo List </h1>
      <div>
        <input type="text" placeholder="add a item" onChange={inputItem} />
        <button onClick={addItem}>Add item</button>
      </div>

      <div>
        <ol>
          {item.map((itemVal) => {
            return <li>{itemVal}</li>;
          })}
        </ol>
      </div>
    </div>
  );
}

export default App;
